import { jsPDF } from "jspdf";
import mysql from "mysql2/promise";

const thSarabunFontBase64 = `

`;



export default async function handler(req, res) {
  const { id } = req.query;

  // สร้างการเชื่อมต่อฐานข้อมูล
  const db = await mysql.createConnection({
    host: "localhost",
    user: "root",
    password: "",
    database: "hrd",
  });
  try {
    // ดึงข้อมูลจากฐานข้อมูล
    const [rows] = await db.execute(
      `
      SELECT 
        tr.*, 
        u.first_name, 
        u.last_name, 
        u.email, 
        u.phone_number, 
        u.position, 
        u.level, 
        u.department,
        u.group_name
      FROM 
        training_reports AS tr
      JOIN 
        users AS u
      ON 
        tr.username = u.username
      WHERE 
        tr.id = ?;
      `,
      [id]
    );

    // ตรวจสอบว่ามีข้อมูลหรือไม่
    if (rows.length === 0) {
      return res.status(404).json({ error: "Data not found" });
    }

    const data = rows[0];

    // สร้าง PDF
    const doc = new jsPDF();

    // เพิ่มฟอนต์ภาษาไทย
    doc.addFileToVFS("THSarabun.ttf", thSarabunFontBase64);
    doc.addFont("THSarabun.ttf", "THSarabun", "normal");
    doc.setFont("THSarabun");


doc.setFontSize(16);
doc.text(`สรุปรายงานการฝึกอบรมรหัส: ${data.id}`, 105, 10, { align: 'center' });  // กึ่งกลางหน้ากระดาษ
doc.setFontSize(14);
doc.text("ข้อมูลผู้ใช้งาน:", 70, 20, { align: 'center' });

// ข้อมูลผู้ใช้งาน (จัดเรียง 2-3 ข้อมูลในแต่ละบรรทัด)
doc.setFontSize(12);
doc.text(`ชื่อ-นามสกุล: ${data.first_name} ${data.last_name}`, 10, 30);
doc.text(`เบอร์โทร: ${data.phone_number}`, 100, 30);
doc.text(`ตำแหน่ง: ${data.position}${data.level}`, 10, 40);
doc.text(`อีเมล์: ${data.email}`, 100, 40);
doc.text(`สำนัก/กอง/ศูนย์: ${data.department}`, 10, 50);
doc.text(`กลุ่ม/ฝ่าย: ${data.group_name}`, 100, 50);

// ข้อมูลรายงานการฝึกอบรม (จัดเรียง 2-3 ข้อมูลในแต่ละบรรทัด)
doc.setFontSize(14);
doc.text("ข้อมูลการฝึกอบรม:", 70, 60, { align: 'center' });
doc.setFontSize(12);

// หน่วยงานฝึกอบรม และ วิชา อยู่คนละบรรทัด
doc.text(`หน่วยงานฝึกอบรม: ${data.trainingOrg || "N/A"}`, 10, 70);  // หน่วยงานฝึกอบรม
doc.text(`วิชา: ${data.courseCode || "N/A"}`, 10, 80);  // วิชา

// หมวดหมู่ และ วิธีการอบรม อยู่ในบรรทัดเดียวกัน
doc.text(`หมวดหมู่: ${data.category || "N/A"}   วิธีการอบรม: ${data.trainingMethod || "N/A"}   สถานที่อบรม: ${data.hybridLocation || "N/A"}`, 10, 90);

// วันที่เริ่มฝึกอบรม และ วันที่สิ้นสุดการฝึกอบรม อยู่คนละบรรทัด
doc.text(`วันที่เริ่มฝึกอบรม: ${data.startDate || "N/A"}`, 10, 100);  
doc.text(`วันที่สิ้นสุดการฝึกอบรม: ${data.endDate || "N/A"}`, 10, 110);

// ค่าใช้จ่าย (จัดเรียง 2-3 ข้อมูลในแต่ละบรรทัด)
doc.setFontSize(14);
doc.text("ข้อมูลค่าใช้จ่าย:", 70, 120, { align: 'center' });
doc.setFontSize(12);
doc.text(`ค่าลงทะเบียน: ${data.regFeeAmount || "N/A"} บาท`, 10, 130);
doc.text(`ค่าที่พัก: ${data.accommodationFeeAmount || "N/A"} บาท`, 100, 130);
doc.text(`ค่าเดินทาง: ${data.transportationFeeAmount || "N/A"} บาท`, 10, 140);
doc.text(`ค่าเบี้ยเลี้ยง: ${data.allowanceFeeAmount || "N/A"} บาท`, 100, 140);
doc.text(`ค่าใช้จ่ายรวม: ${data.totalCost || "N/A"} บาท`, 100, 150);
doc.text(`งบประมาณจากกรมประมง: ${data.internalBudget || "N/A"} บาท`, 10, 160);
doc.text(`งบประมาณจาก${data.externalAgency || "N/A"}: ${data.externalBudget || "N/A"} บาท`, 100, 160);

// ข้อมูลแผนงานและผลผลิต (จัดเรียง 2-3 ข้อมูลในแต่ละบรรทัด)
doc.setFontSize(14);
doc.text("ข้อมูลแผนงานและผลผลิต:", 70, 170, { align: 'center' });
doc.setFontSize(12);
doc.text(`เบิกจ่ายงบประมาณจากแผนงาน: ${data.planBudget || "N/A"}`, 10, 180);
doc.text(`ผลผลิต/โครงการ: ${data.projectOutput || "N/A"}`, 100, 180);
doc.text(`กิจกรรมหลัก: ${data.mainActivity || "N/A"}`, 10, 190);
doc.text(`กิจกรรมย่อย: ${data.subActivity || "N/A"}`, 100, 190);

// ข้อมูลการนำความรู้ไปใช้ (จัดเรียง 2-3 ข้อมูลในแต่ละบรรทัด)
doc.setFontSize(14);
doc.text("การนำความรู้ไปใช้ประโยชน์:", 70, 200, { align: 'center' });
doc.setFontSize(12);
doc.text(`1. พัฒนาตนเอง/นำมาเป็นแนวทางในการปฏิบัติงาน: ${data.knowledgeSelfDevelop || "N/A"}`, 10, 210);
doc.text(`2. พัฒนา/แก้ไขปัญหา/ปรับปรุง/เปลี่ยนแปลงงานที่ปฏิบัติ: ${data.knowledgeWorkImprove || "N/A"}`, 10, 220);
doc.text(`3. แลกเปลี่ยนมุมมองระหว่างทีมงาน: ${data.knowledgeTeamwork || "N/A"}`, 10, 230);
doc.text(`4. เกิดการเปลี่ยนแปลงในด้านประสิทธิภาพและประสิทธิผล: ${data.knowledgeEfficiency || "N/A"}`, 10, 240);
doc.text(`5. สร้างเครือข่ายและบูรณาการทำงาน: ${data.knowledgeNetworking || "N/A"}`, 10, 250);



    // ส่ง PDF เป็นไฟล์ให้ผู้ใช้
    const pdf = doc.output("arraybuffer");
    res.setHeader("Content-Type", "application/pdf");
    res.send(Buffer.from(pdf));
  } catch (error) {
    console.error(error);
    res.status(500).json({ error: "Internal server error" });
  } finally {
    // ปิดการเชื่อมต่อฐานข้อมูล
    await db.end();
  }
}